import React from 'react';
import { Route, BrowserRouter , Link, Switch} from 'react-router-dom';
import ReceipeList from './components/receipes/List';
import ReceipeAdd from './components/receipes/Add';
import ReceipeShow from './components/receipes/Show';
import SignUp from './components/SignUp';
import Login from './components/Login'

function App() {
  const handleLogout=()=>{
    props.dispatch(startLogout())
  }
  return (
    <BrowserRouter>
    <div>
      <h1>Food Receipe</h1>
      <Link to="/">Home</Link>
                {
                    Object.keys(props.register).length !== 0 ? (
                        <div>
                            {/* <Link to="/users/account">Account</Link> */}
                            <Link to="#" onClick={handleLogout}>Logout</Link>
                        </div>
                    ) : (
                            <div>
                                <Link to="/users/register">Register</Link>
                                <Link to="/users/login">Login</Link>

                            </div>
                        )
                }
       <Switch>
       <Route path='/users/register' component={SignUp}/>
      <Route path='/users/login' component={Login}/>
      <Route path='/receipes' component={ReceipeList} exact={true}/>
      <Route path='/receipes/new' component={ReceipeAdd} exact={true}/>
      <Route path='/receipes/:id' component={ReceipeShow}/>
      </Switch>
    </div>
    </BrowserRouter>
  )
}

export default App;
